import{_ as e,c as a,o,a4 as t}from"./chunks/framework.luo6lmAI.js";const n="/fe-handbook/assets/v2-2748a0dbe09fad1b21998c2e64621962_r.BLHlRDng.jpg",h=JSON.parse('{"title":"CNAME","description":"","frontmatter":{},"headers":[],"relativePath":"fundamentals/network/domain-cname.md","filePath":"fundamentals/network/domain-cname.md","lastUpdated":1713633220000}'),c={name:"fundamentals/network/domain-cname.md"},r=t('<h1 id="cname" tabindex="-1">CNAME <a class="header-anchor" href="#cname" aria-label="Permalink to &quot;CNAME&quot;">​</a></h1><blockquote><p>A记录是将域名解析成IP，CNAME是将域名解析成另外一个域名。</p></blockquote><p><img src="'+n+'" alt="img"></p><blockquote><p>CNAME即别名( Canonical Name )；可以用来把一个域名解析到另一个域名，当 DNS 系统在查询 CNAME 左面的名称的时候，都会转向 CNAME 右面的名称再进行查询，一直追踪到最后的 PTR 或 A 名称，成功查询后才会做出回应，否则失败。</p></blockquote><blockquote><p>你有一台服务器上存放了很多资料，你使用docs.example.com去访问这些资源，但又希望通过documents.example.com也能访问到这些资源，那么你就可以在您的DNS解析服务商添加一条CNAME记录，将documents.example.com指向docs.example.com，添加该条CNAME记录后，所有访问documents.example.com的请求都会被转到docs.example.com，获得相同的内容。</p></blockquote><h2 id="reference" tabindex="-1">Reference <a class="header-anchor" href="#reference" aria-label="Permalink to &quot;Reference&quot;">​</a></h2><ul><li><a href="https://blog.csdn.net/DD_orz/article/details/100034049" target="_blank" rel="nofollow noopener noreferrer">https://blog.csdn.net/DD_orz/article/details/100034049</a></li></ul>',7),l=[r];function s(m,d,i,_,p,u){return o(),a("div",null,l)}const b=e(c,[["render",s]]);export{h as __pageData,b as default};
